import React from "react";
import "./Header.scss";
import logo from "./abm-logo.svg";

const Header = () => {
  return (
    <>
      <img src={logo} alt="Artistry by Mel logo" class="logo" />
      <nav>
        <ul>
          <li class="nav-link">Home</li>
          <li class="nav-link">My Work</li>
          <li class="nav-link">Book</li>
        </ul>
      </nav>
    </>
  );
};

export default Header;
